// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import AddExpense from "./pages/AddExpense";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Welcome from "./pages/Welcome";  // Importing the new Welcome page

const App = () => {
  return (
    <Router>
      <div className="p-6">
        <h1 className="text-3xl font-bold">Fitness Assistant</h1>
        <nav className="my-4">
          <a href="/" className="mr-4">Dashboard</a>
          <a href="/add-expense">Add Expense</a>
        </nav>
        <Routes>
          <Route path="/" element={<Welcome />} /> {/* Set Welcome page as the homepage */}
          <Route path="/add-expense" element={<AddExpense />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
